import "./top.css";
export default function top() {
  return (
    <div className="topContainer">
      <div className="topLeft">
        <span className="Logo">To Do List!</span>
      </div>
      <div className="topRight">
        <span className="logout">Logout</span>
      </div>
    </div>
  );
}
